import "./App.css";
import Slide1 from "./assets/Slide11.jpg";

function App() {
  return (
    <div className="w-full">
      <div className="Header w-[100wh] h-[100vh]  ">
        <img
          src={Slide1}
          alt="Not available"
          className="w-full h-full bg-contain"
        />
      </div>
    </div>
  );
}

export default App;
